import React,{useContext} from 'react';
import { auth } from '../Firebase/Config';
import {UserContext} from '../context/User'

const Home = () => {

  const {} = useContext(UserContext)
  return (
    <div>
      <h2>welcome</h2>
      <button onClick={() => auth.signOut()}>signOut</button>
    </div>
  );
};

export default Home;
